import './App.css'; // Import your CSS file for styling

class App extends Component {
  render() {
    return (
      <div className="App">
        <Nav />
        <div className="main-content">
          <section id="home">
            <Home />
          </section>
          <section id="about">
            <About />
          </section>
          <section id="projects">
            <Projects />
          </section>
          <section id="contact">
            <Contact />
          </section>
          <footer className="footer">
            <h1>Copyright Â© 2023. All rights are reserved</h1>

           </footer>
        </div>
      </div>
    );
  }
}

export default App;
